    axios.post('https://notifier-staging.tokopedia.com/imt/api/v1/user/add',{headers:{
        'X-GA-ID':'232377',
    },data})
        .then(function (response) {
            console.log('response is abc' ,response.data.userId)
            if (response.data.userId){
                alert("you are subscribed with user id ",response.data.userId)
            }
        })
        .catch(function (error) {
            console.log('not enter in sucess function ' , error)
        });
}



